import styled from 'styled-components';

export const ContactContainer = styled.div`
  display: flex;
  flex-direction: column;
  height: 50vh;
  align-items: center;
  justify-content: center;
`;

export const ContactListItem = styled.li`
  justify-content: center;
  display: flex;
  align-items: center;
  list-style: none;
  font-size: 30px;
`;
